import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import AccountCircle from "@material-ui/icons/AccountCircle";
import HttpsIcon from "@material-ui/icons/Https";
import Form from "../common/Form";

const registerContent = [
  {
    id: "0",
    icon: <AccountCircle />,
    text: <TextField id="register-username" label="Username" error={false} />,
  },
  {
    id: "1",
    icon: <HttpsIcon />,
    text: <TextField id="register-password" label="Password" type="password" />,
  },
  {
    id: "2",
    icon: <HttpsIcon />,
    text: (
      <TextField
        id="register-password2"
        label="Reenter Password"
        type="password"
      />
    ),
  },
];
const registerButton = <Button variant="contained">Register</Button>;

class Register extends Component {
  render() {
    return (
      <Form
        title="Register"
        formContent={registerContent}
        button={registerButton}
      />
    );
  }
}

const mapStateToProps = (state) => {
  console.log(state.todoState);
  return {
    todos: state.todoState,
  };
};

export default connect(mapStateToProps)(Register);
